<!DOCTYPE html>

<!-- Created with Ai->Canvas Export Plug-In Version 1.3 (Mac)   -->
<!-- By Mike Swanson (http://blog.mikeswanson.com/)             -->

<html lang="en">
 <head>
  <meta charset="UTF-8" />
  <title>G</title>
  <script>

    function init() {

      var canvas = document.getElementById("canvas");
      var ctx = canvas.getContext("2d");

      draw(ctx);
    }

    function draw(ctx) {

      // layer1/Group
      ctx.save();

      // layer1/Group/Compound Path
      ctx.save();
      ctx.beginPath();

      // layer1/Group/Compound Path/Path
      ctx.moveTo(0.0, 17.2);
      ctx.lineTo(0.0, 2.4);
      ctx.lineTo(2.4, 2.4);
      ctx.lineTo(2.4, 0.0);
      ctx.lineTo(16.7, 0.0);
      ctx.lineTo(16.7, 5.2);
      ctx.lineTo(6.5, 5.2);
      ctx.lineTo(6.5, 14.4);
      ctx.lineTo(11.5, 14.4);
      ctx.lineTo(11.5, 10.8);
      ctx.lineTo(16.7, 10.8);
      ctx.lineTo(16.7, 19.6);
      ctx.lineTo(2.4, 19.6);
      ctx.lineTo(2.4, 17.2);
      ctx.lineTo(0.0, 17.2);
      ctx.closePath();
      ctx.fill();
      ctx.restore();
      ctx.restore();
    }
  </script>
 </head>
 <body onload="init()">
   <canvas id="canvas" width="57" height="79"></canvas>
 </body>
</html>
